import React, { useState } from "react";

const SearchResult = () =>{
    let [viewImage, setViewImage] =useState("")
    const image_result = `https://source.unsplash.com/400x300/?mango`
    return (
        <>
            <div className="Searchbar">
                <img src={image_result} alt="Search-result" />
            </div>
        </>
    )

}
export default SearchResult;
